import { Fragment } from "react";
import UsersList from "../components/UI/UsersList";
import ReactPaginate from "react-paginate";

const UsersPage = () => {
  return (
    <Fragment>
      <UsersList />
      <ReactPaginate
        pageCount={5}
        pageRangeDisplayed={5}
        marginPagesDisplayed={3}
      />
    </Fragment>
  );
};

export default UsersPage;
